import React from 'react'
import Button from '../UI/Button';
import Dropdown from '../Dropdown/Dropdown';
import { Link } from 'react-router-dom';
import './Navbar.css';

const Navbar = () => {

  return(
    <nav className="navbar">
      <Link className='navbar-logo'></Link>
    </nav>
  );
};

export default Navbar;
